function setLanguage(n,t){var i=n+"?culture="+t+"&returnUrl="+window.location.pathname;$("<form>").attr("method","post").attr("action",i).appendTo(document.body).submit()}$(document).ready(function(){$("#lang-en").click(function(n){n.preventDefault();setLanguage($(this).attr("href"),"en")});$("#lang-es").click(function(n){n.preventDefault();setLanguage($(this).attr("href"),"es-US")})});